    {
        name: "Home",
        icon: <FontAwesomeIcon icon={faCoffee} />,
        path: "/",
        subMenu: []
    },
    {
        name: "About",
        icon: <FontAwesomeIcon icon={faCoffee} />,
        path: "/about",
        subMenu: []
    },
    {
        name: "Contact Us",
        icon: <FontAwesomeIcon icon={faCoffee} />,
        path: "/contact",
        subMenu: [
            {
                name: "List",
                icon: "faCoffee",
                path: "/contact/list",
                subMenu: [] 
            },
            {
                name: "Create",
                icon: "faCoffee",
                path: "/contact/create",
                subMenu: [] 
            },
            {
                name: "Update",
                icon: "CiHome",
                path: "/contact/update",
                subMenu: [] 
            },
            {
                name: "Delete",
                icon: "CiHome",
                path: "/contact/delete",
                subMenu: [] 
            }
        ]
    }
];

export default menus;
